import main.lisp.parser.terms.SExpression;

public class LambdaEvaluator implements Evaluator{

	@Override
	public SExpression eval(SExpression expression, Environment environment) {
		if (expression.getTail() instanceof NilAtom) {
			throw new RuntimeException("LAMBDA needs a body");
		}

		// Proccess Arguements
		SExpression curr = expression.getHead();
		List<IdentifierAtom> args = new ArrayList<IdentifierAtom>();
		while (!curr.isAtom()) {
			if (!(curr.getHead() instanceof IdentifierAtom)) {
				throw new RuntimeException("Parameters of lambda must be only identifiers");
			}
			args.add((IdentifierAtom) curr.getHead());
			curr = curr.getTail();
		}


		expression = expression.getTail();
		return LambdaFactory.newInstance(args.toArray(new IdentifierAtom[args.size()]), expression.getTail());
	}

}
